<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1,user-scalable=no,viewport-fit=cover">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Spongebob</title>
    <link rel="stylesheet" href="style.589b4ad4.css">
</head>

<body>
    <style id="demo2"> </style>
    <div id="demo1"></div>
    <div class="btn">
        <button id="btnPause">暂停</button>
        <button id="btnPlay">播放</button>
        <button id="btnFast">快速</button>
        <button id="btnNormal">正常</button>
        <button id="btnSlow">慢速</button>
    </div>
    <div id="projectShow">
        <div class="skin">
            <div class="eyes">
                <div class="eyeBrowLeft">
                    <div class="brow1"></div>
                    <div class="brow2"></div>
                    <div class="brow3"></div>
                </div>
                <div class="eyeBrowRight">
                    <div class="brow1"></div>
                    <div class="brow2"></div>
                    <div class="brow3"></div>
                </div>
                <div class="eyeLeft">

                    <div class="eyesBallLeft">
                        <div class="black"></div>
                    </div>
                </div>
                <div class="eyeRight">

                    <div class="eyesBallRight">
                        <div class="black"></div>
                    </div>
                </div>
            </div>
            <div class="nose">
                <div class="box"></div>
            </div>
            <div class="cheek">
                <div class="cheekLeft">
                    <div class="circleL">
                        <div class="point1"></div>
                        <div class="point2"></div>
                        <div class="point3"></div>
                    </div>
                </div>

                <div class="cheekRight">
                    <div class="circleL">
                        <div class="point1"></div>
                        <div class="point2"></div>
                        <div class="point3"></div>
                    </div>
                </div>

            </div>
            <div class="mouth">
                <div class="circleLeft"></div>
                <div class="circleCenter"></div>
                <div class="circleRight"></div>
                <div class="teethLeft"></div>
                <div class="teethRight"></div>

            </div>
            <div class="circle">
                <div class="circleLeft2">

                </div>
                <div class="circleRight2">

                </div>

            </div>
            <div class="hole1"></div>
            <div class="hole2"></div>
            <div class="hole3"></div>
            <div class="hole4"></div>
            <div class="hole5"></div>
            <div class="hole6"></div>
            <div class="hole7"></div>
        </div>
    </div>
    <script src="main.7dc753b1.js"></script>
</body>

</html>
